import React from "react";

import "./cat.style.scss";

const Cat = ({ title, icon, list }) => {
  return (
    <div className='cat'>
      <i></i>
      <span className='title'>{title}</span>

      <h4 className='list'>{list}</h4>
    </div>
  );
};

export default Cat;
